import React from "react";
import "../styles/AboutMe.css"; // Optional: Add a CSS file for styling
import profilePic from "../images/profilepic.jpg"; // Replace with the actual image file name

const AboutMe = () => {
  return (
    <div className="about-me-container">
      <img src={profilePic} alt="Profile" className="profile-pic" />
      <h1>About Me</h1>
      <p>
        Hi, I'm Amanda! I'm a passionate web developer with a love for creating
        beautiful and functional websites. I specialize in React, JavaScript,
        and modern web technologies. Welcome to my personal website!
      </p>
    </div>
  );
};

export default AboutMe;
